import React from 'react';

const Logo = () => (
    <div className='header__logo'>
        <div className='header__logo-top'>SJ</div>
        <div className='header__logo-bottom'>
            <span className="header__text green">FOOD</span>
            <span className="header__text white">DELIVERY</span>
        </div>
    </div>
);

export default Logo;
